import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { BrowserRouter } from "react-router-dom";
import Recoil from "recoil";
ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Recoil>
        <App />
      </Recoil>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById("root")
);
